// 再生機能
function playSelectedFile() {
    const formValues = [
        document.querySelector('input[name="range"]:checked')?.value,
        document.querySelector('input[name="jump"]:checked')?.value,
        document.querySelector('input[name="timing"]:checked')?.value,
        document.querySelector('input[name="simulCount"]:checked')?.value,
        document.querySelector('input[name="chord"]:checked')?.value,
        document.querySelector('input[name="rhythm"]:checked')?.value,
        document.querySelector('input[name="accent"]:checked')?.value,
        document.querySelector('input[name="hand"]:checked')?.value,
        document.querySelector('input[name="tone"]:checked')?.value
    ];

    let selectedFile = audioFileMap;
    for (const value of formValues) {
        if (selectedFile && selectedFile[value]) {
            selectedFile = selectedFile[value];
        } else {
            selectedFile = null;
            break;
        }
    }

    let BselectedFile = BaudioFileMap;
    const rhythmValue = document.querySelector('input[name="rhythm"]:checked')?.value;
    if (BselectedFile && rhythmValue && BselectedFile[rhythmValue]) {
        BselectedFile = BselectedFile[rhythmValue];
    } else {
        BselectedFile = null;
    }

    if (typeof selectedFile === 'string' && typeof BselectedFile === 'string') {
        const audioPlayer1 = document.getElementById('audioPlayer1');
        const audioPlayer2 = document.getElementById('audioPlayer2');
        audioPlayer1.src = selectedFile;
        audioPlayer2.src = BselectedFile;


        // 音量の初期値を設定
        audioPlayer1.volume = 1.0; // 0.0 (ミュート) ~ 1.0 (最大音量)
        audioPlayer2.volume = 0.4;

        
       // 両方の音声ファイルが読み込まれるまで待機
        Promise.all([
            new Promise((resolve) => {
                audioPlayer1.addEventListener('loadeddata', resolve, { once: true });
            }),
            new Promise((resolve) => {
                audioPlayer2.addEventListener('loadeddata', resolve, { once: true });
            })
        ]).then(() => {
            // 両方の読み込みが完了したら再生
            audioPlayer1.play();
            audioPlayer2.play();
        }).catch(() => {
            alert("音声ファイルの読み込み中にエラーが発生しました。");
        });
    } else {
        alert("該当するファイルが見つかりません。");
    }
}


function playstop() {
    const audioPlayer1 = document.getElementById('audioPlayer1');
    const audioPlayer2 = document.getElementById('audioPlayer2');
    audioPlayer1.pause();
    audioPlayer2.pause();
}

// 選択したラジオボタンの値をh2に表示する関数
function updateHeadingText(formId, headingElement) {
    const form = document.getElementById(formId);
    const selectedOption = form.querySelector('input[type="radio"]:checked');
    if (selectedOption) {
        headingElement.textContent = headingElement.dataset.baseText + " ・ " + selectedOption.value;
    }
}

// 折りたたみ機能と選択の変更時に呼び出される関数
function toggleCollapse(element) {
    const content = element.nextElementSibling;
    if (content.style.display === "none" || content.style.display === "") {
        content.style.display = "block";
        element.textContent = element.textContent.replace("▼", "▲");
    } else {
        content.style.display = "none";
        element.textContent = element.textContent.replace("▲", "▼");
    }
}

// 各フォームにイベントリスナーを追加してラジオボタン選択時に呼び出す
document.querySelectorAll('.form-card').forEach(form => {
    const headingElement = form.querySelector('h2');
    headingElement.dataset.baseText = headingElement.textContent; // 基本の見出しテキストを保存
    form.addEventListener('change', () => updateHeadingText(form.id, headingElement));
});

function changeloop(Button){
    const audioPlayer1 = document.getElementById('audioPlayer1');
    const audioPlayer2 = document.getElementById('audioPlayer2');

    audioPlayer1.loop=!audioPlayer1.loop;
    audioPlayer2.loop=!audioPlayer2.loop;
    
    Button.textContent = Button.textContent==="ループ無効"?"ループ有効":"ループ無効";
    
}

function applyPreset(presetValues) {
    for (const [name, value] of Object.entries(presetValues)) {
        const input = document.querySelector(`input[name="${name}"][value="${value}"]`);
        if (input) {
            input.checked = true; // ラジオボタンを選択

            // 対応するh2要素を更新
            const form = input.closest('form'); // 対応するform要素を取得
            const h2 = form.querySelector('h2'); // form内のh2要素を取得
            if (h2) {
                h2.textContent = h2.textContent.split("・")[0] + `・${value}`;
            }
        }
    }
}

